import gamesObject from '../games.json';
import { Image } from 'react-bootstrap';

function ListMovies() {
    const games = gamesObject.games;
    return (
        <div className="Container flex" style={{paddingTop: '30px'}}>
        <div className="row justify-content-center">
            {games.map((game) => (
                <div key={game.name} className="col-auto mb-2">
                    <Image src={game.coverUrl} alt={game.name} width="250" height="450"/>
                </div>
            ))}
        </div>
        </div>
    )
}

export default ListMovies;
